Texto:
Krush es un juego competitivo donde te enfrentas a otros jugadores en muchos mapas que el juego tiene para ofrecer. Crea facciones, juega de forma independiente, o hazte un nombre y conviértete en una leyenda en la comunidad.


TRONCOS DE DESARROLLO
