05/03 - Se ha añadido la alimentación de matar;
03/03 - Efectos de Muerte añadidos;
28/02 - HUD Editar añadido;
28/02 - Edición Skybox añadida;
27/02 - Se ha añadido la configuración de Cruce;
25/02 - Efectos de trazador añadidos;
25/02 - Boombox añadido.

