Bloodshed es un juego en el que combates y dominas a otros jugadores, te diviertes con amigos y tal vez hagas nuevos amigos.

El derramamiento de sangre está en la etapa Alpha; las cosas están sujetas a cambios y, por supuesto, podría haber errores y fallos [has sido advertido]

¡Únete al grupo de roblox!: https:// www.roblox.com/groups/8058922/vido-gams #!/sobre

Cómo jugar: La mecánica del juego selecciona un arma/herramienta al azar para ti. Combate y mata a cada uno y a otros jugadores.

problemas conocidos: artículos que se desequilibran (trabajando en ello)

